import {SearchIcon, CloseIcon} from '@mui/icons-material';
import { TextField, InputAdornment, SvgIcon } from '@mui/material';
export default function Buscador() {
  return (
    <div className="App">
        <TextField id="outlined-basic" label="Ingrese texto" variant="outlined" 
        InputProps={{
            endAdornment: (
              <InputAdornment position="start">
                <svg data-testid="SearchIcon"></svg>
              </InputAdornment>
            ),
          }}/>
    </div>
  );
}
